import { Row, Col } from 'antd';
import './style-main.css';

function Main(props) {
  return (
    <>
      <Row>
        <Col
          xs={{ span: 4, offset: 0 }}
          sm={{ span: 4, offset: 1 }}
          md={{ span: 6, offset: 0 }}
          lg={{ span: 10, offset: 2 }}
        >
          <div className="left">
            <p>
              A <bold style={{ color: '#94C529' }}></bold>Built
              On Proof.
            </p>
          </div>
        </Col>
      </Row>
    </>
  );
}

export default Main;
